# Seleccionar solo las columnas numéricas junto con la variable categórica 'cut'
columns_to_plot = ['carat', 'depth', 'table', 'price', 'x', 'y', 'z', 'cut']

# Crear el pair plot
sns.pairplot(data[columns_to_plot], hue='cut', palette='viridis')
plt.show()

"""## **3. Preparación de los datos**

Eliminar columnas irrelevantes y codificar las variables categóricas usando "One Hot Encoding"
"""

# Eliminar la columna Unnamed: 0
data = data.drop(columns=['Unnamed: 0'])

# Codificar variables categóricas usando One'Hot Encoding
data = pd.get_dummies(data, columns=['cut', 'color', 'clarity'], drop_first=True)

data.head(5)

"""Separar variables de entrenamiento y objetivo. Se fija un valor semilla de 123 y la proporción de datos de ensayo del 30%"""

# Separar las características (X) y la variable objetivo (y)
X = data.drop(columns=['price'])
y = data['price']

# Dividir los datos en conjuntos de entrenamiento y prueba
X_train, X_test, y_train, y_test = train_test_split(X, y, test_size=0.3, random_state=123)

"""## **4. Modelos de entrenamiento**

### **4.1 Regresión lineal**
"""

# Inicializar el modelo de regresión lineal
linear_model = LinearRegression()

# Entrenar el modelo
linear_model.fit(X_train, y_train)

# Realizar predicciones en el conjunto de prueba
y_pred = linear_model.predict(X_test)

# Evaluación del modelo
rmse = np.sqrt(mean_squared_error(y_test, y_pred))
r2 = r2_score(y_test, y_pred)

print(f"Root Mean Squared Error (RMSE): {rmse}")
print(f"R^2 Score: {r2}")

"""### **4.2 Random Forest**"""

# Inicializar el modelo de Random Forest con un número de estimadores y profundidad máxima
rf_model = RandomForestRegressor(n_estimators=100, max_depth=None, random_state=123)

# Entrenar el modelo
rf_model.fit(X_train, y_train)

# Realizar predicciones en el conjunto de prueba
y_pred_rf = rf_model.predict(X_test)

# Evaluación del modelo
rmse_rf = np.sqrt(mean_squared_error(y_test, y_pred_rf))
r2_rf = r2_score(y_test, y_pred_rf)

print(f"Root Mean Squared Error (RMSE) - Random Forest: {rmse_rf}")
print(f"R^2 Score - Random Forest: {r2_rf}")

"""Ajuste de hiperparámetros haciendo uso de `RandomizedSearchCV`"""

# Definir el modelo base
rf = RandomForestRegressor(random_state=123)

# Definir los parámetros de búsqueda
param_distributions = {
  'n_estimators': [100, 200, 300, 400, 500],
  'max_depth': [None, 10, 20, 30, 40, 50],
  'min_samples_split': [2, 5, 10],
  'min_samples_leaf': [1, 2, 4],
  'max_features': ['auto', 'sqrt', 'log2']
}

# Configurar RandomizedSearchCV
random_search = RandomizedSearchCV(
  estimator=rf,
  param_distributions=param_distributions,
  n_iter=50,  # Número de combinaciones aleatorias a probar
  scoring='neg_mean_squared_error',  # Utilizamos el MSE como métrica para evaluar
  cv=5,  # Número de folds en la validación cruzada
  random_state=123,
  n_jobs=-1  # Usar todos los núcleos disponibles para acelerar
)

# Realizar la búsqueda de hiperparámetros
random_search.fit(X_train, y_train)

# Obtener los mejores parámetros y el mejor puntaje
best_params = random_search.best_params_
best_score = np.sqrt(-random_search.best_score_)

print("Mejores parámetros encontrados:")
print(best_params)
print(f"Mejor RMSE obtenido en validación cruzada: {best_score}")

"""* param_distributions: Definimos el rango de valores para cada parámetro que queremos probar. Puedes ampliar o ajustar los valores según lo desees.
* n_iter=50: Especifica cuántas combinaciones aleatorias probar. Puedes incrementarlo para una búsqueda más exhaustiva.
* scoring='neg_mean_squared_error': Utilizamos MSE como métrica, pero lo convertimos a RMSE al final.
* cv=5: Realizamos una validación cruzada de 5 pliegues para evaluar cada combinación de parámetros.
"""

# Extraer los resultados de la búsqueda de hiperparámetros
results = pd.DataFrame(random_search.cv_results_)

# Gráfico de RMSE en función de n_estimators
plt.figure(figsize=(12, 6))
sns.lineplot(data=results, x='param_n_estimators', y='mean_test_score', marker='o')
plt.title('Evolución del RMSE en función de n_estimators')
plt.xlabel('Número de Árboles (n_estimators)')
plt.ylabel('Neg. Mean Squared Error (en validación)')
plt.gca().invert_yaxis()  # Invertir el eje para que el RMSE menor esté arriba
plt.show()

# Gráfico de RMSE en función de max_depth
plt.figure(figsize=(12, 6))
sns.lineplot(data=results, x='param_max_depth', y='mean_test_score', marker='o')
plt.title('Evolución del RMSE en función de max_depth')
plt.xlabel('Profundidad Máxima (max_depth)')
plt.ylabel('Neg. Mean Squared Error (en validación)')
plt.gca().invert_yaxis()  # Invertir el eje para que el RMSE menor esté arriba
plt.show()

"""Se refina el ajuste de hiperparámetros utilizando rangos más específicos en `RandomizedSearchCV`. Con base en los gráficos anteriores, se limita los valores de `n_estimators` y `max_depth` para centrarse en las zonas de las combinaciones más prometedoras."""

# Definir los parámetros de búsqueda ajustados
