"""## **6. MLFlow**"""

# Importe las bibliotecas necesarias
import mlflow
import mlflow.sklearn
from xgboost import XGBRegressor
from sklearn.metrics import mean_squared_error
from sklearn.model_selection import train_test_split
import pandas as pd

# Cargar el conjunto de datos de diamantes
data = pd.read_csv('diamonds.csv')  # Asegúrate de que el archivo esté en el entorno de Databricks o ajusta la ruta si está en un almacenamiento compartido

# Preprocesamiento
data = data.drop(columns=['Unnamed: 0'])
data = pd.get_dummies(data, columns=['cut', 'color', 'clarity'], drop_first=True)
X = data.drop(columns=['price'])
y = data['price']

# Dividir los datos en conjuntos de entrenamiento y prueba
X_train, X_test, y_train, y_test = train_test_split(X, y, test_size=0.3, random_state=123)

# Definir el experimento en MLflow (comentar la línea de tracking_uri si es necesario en Databricks)
# mlflow.set_tracking_uri('http://localhost:5000')  # Comenta esta línea si usas Databricks
experiment = mlflow.set_experiment("xgboost-diamonds")

# Parámetros del mejor modelo XGBoost que encontramos
best_params_xgb = {
    'n_estimators': 400,
    'max_depth': 6,
    'learning_rate': 0.1,
    'subsample': 0.8,
    'colsample_bytree': 0.8
}

# Configuración y registro del modelo en MLflow
with mlflow.start_run(experiment_id=experiment.experiment_id):
    # Crear el modelo con los mejores parámetros
    xgb_model = XGBRegressor(**best_params_xgb, random_state=123)
    xgb_model.fit(X_train, y_train)

    # Realizar predicciones en el conjunto de prueba
    predictions = xgb_model.predict(X_test)

    # Calcular el RMSE y registrar el parámetro
    rmse = mean_squared_error(y_test, predictions, squared=False)  # `squared=False` calcula el RMSE directamente
    mlflow.log_metric("rmse", rmse)
    mlflow.log_metric("r2", xgb_model.score(X_test, y_test))  # También registramos el R²

    # Registrar los parámetros del modelo
    mlflow.log_param("n_estimators", best_params_xgb['n_estimators'])
    mlflow.log_param("max_depth", best_params_xgb['max_depth'])
    mlflow.log_param("learning_rate", best_params_xgb['learning_rate'])
    mlflow.log_param("subsample", best_params_xgb['subsample'])
    mlflow.log_param("colsample_bytree", best_params_xgb['colsample_bytree'])

    # Registrar el modelo en MLflow
    mlflow.sklearn.log_model(xgb_model, "xgboost-model")

# Imprimir el RMSE como referencia
print(f"RMSE del modelo optimizado (XGBoost): {rmse}")